import '../App.css';
import React, { useState } from "react";
import car1 from "../assets/car1.jpeg";

function CarPhoto() {
    const [photo, setPhoto] = useState(car1);

    return  (
        <div className="car-photo">
            <img src={photo} alt="차량 이미지"/>
        </div>
    );
}

export default CarPhoto;
